import React from 'react';
import style from './style.scss'

const SocButton = ({link, text, classlist, datasoc, socicon}) => {
 return (
<a target='_blank' href='https://vk.com/share.php?image=https%3A%2F%2Fe-on.tnt-online.ru%2Fimage%2Fvk_share%2F1.jpg&url=https%3A%2F%2Fe-on.tnt-online.ru%2F%3Ftagres%3D0&title=%D0%9F%D1%80%D0%BE%D0%B9%D0%B4%D0%B8+%D1%82%D0%B5%D1%81%D1%82+%D0%B8+%D1%83%D0%B7%D0%BD%D0%B0%D0%B9%2C+%D0%BA%D0%B0%D0%BA+%D0%B4%D0%B0%D0%BB%D0%B5%D0%BA%D0%BE+%D1%82%D1%8B+%D0%BF%D1%80%D0%BE%D0%B9%D0%B4%D0%B5%D1%88%D1%8C+%D0%B2+%D1%88%D0%BE%D1%83+%C2%AB%D0%9F%D0%95%D0%A1%D0%9D%D0%98%C2%BB%21' className={`btn-soc ${classlist}`} data-soc={datasoc} onClick={console.log('click')}>
<span className='authoriz-icon'><i className={socicon}/></span>
<span className='authoriz-text'>{text}</span>
</a>
    );
};

export default SocButton;
